import React from 'react';

function Studentanalytics() {
  // Sample data for the table
  const data = [
    { id: 1, title: 'Project 1', teamLead: 'John Doe', college: 'ABC University', downloads: 100, views: 500 },
    { id: 2, title: 'Project 2', teamLead: 'Jane Smith', college: 'XYZ College', downloads: 50, views: 250 },
    // Add more data as needed
  ];

  return (
    <table>
      <thead>
        <tr>
          <th>S.NO</th>
          <th>Project Title</th>
          <th>Team Lead</th>
          <th>College</th>
          <th>Downloads</th>
          <th>Views</th>
        </tr>
      </thead>
      <tbody>
        {data.map((project, index) => (
          <tr key={project.id}>
            <td>{index + 1}</td>
            <td>{project.title}</td>
            <td>{project.teamLead}</td>
            <td>{project.college}</td>
            <td>{project.downloads}</td>
            <td>{project.views}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Studentanalytics;
